import Layout from '../compontents/layout';
import styles from './compontents/layout.module.css';

const About = () => (
    <Layout>
        <div>
            <p><strong>About ME</strong></p> 
        </div>
        <img
              src="../profile.jpg"
              className={`${styles.headerHomeImage} ${styles.borderCircle}`}
              alt={name}
            />
    </Layout>
);
export default About;
